%sql
SELECT caseid, MonthVal, Year, BMI_STDEV/100 as BMI_STDEV,
    if(Vaccination = 1, 1, 0) as HasBeenVaccinated,
    if((Diarrhea = 1) OR (Diarrhea = 2), 1, 0) as HadDiarrhea,
    if(Weight_Age/100 <= -2, 1, 0) as Wasted,
    if((SPEI_3 <= 0) AND (SPEI_3 > -1), 1, 0) as MildDrought,
    if((SPEI_3 <= -1) AND (SPEI_3 > -1.5), 1, 0) as ModerateDrought,
    if((SPEI_3 <= -1.5), 1, 0) as ExtremeDrought
FROM africanData
WHERE BMI_STDEV IS NOT NULL AND Vaccination IS NOT NULL AND Diarrhea IS NOT NULL AND Weight_Age IS NOT NULL AND FLOOR(BMI_STDEV/100) <> 99

