val splitSeed = 12345
val Array(trainingData, testData) = logRegStuntingDF.randomSplit(Array(0.9, 0.1), splitSeed)
// create the classifier,  default parameters for now**

//logistic regression using L2 regularization (setElasticNetParam) with default regularization parameter(penalty) of 0 (for demo purposes, will change for actual analysis)
val lr = new LogisticRegression()
  .setMaxIter(10)
  .setElasticNetParam(0.5)


val pipeline = new Pipeline()
  .setStages(Array(lr))
  
val paramGrid = new ParamGridBuilder()
  .addGrid(lr.regParam, Array(0.1, 0.01))
  .build()

// We now treat the Pipeline as an Estimator, wrapping it in a CrossValidator instance.
// This will allow us to jointly choose parameters for all Pipeline stages.
// A CrossValidator requires an Estimator, a set of Estimator ParamMaps, and an Evaluator.
// Note that the evaluator here is a BinaryClassificationEvaluator and its default metric
// is areaUnderROC.
val cv = new CrossValidator()
  .setEstimator(pipeline)
  .setEvaluator(new BinaryClassificationEvaluator)
  .setEstimatorParamMaps(paramGrid)
  .setNumFolds(5)


//  use logistic regression to train (fit) the model with the training data**
val stuntingModel = cv.fit(trainingData)  

val stuntingPredictions = stuntingModel.transform(testData)

